-- Name: end_sem(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.end_sem() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE current_sem varchar;
BEGIN
select INTO current_sem * from get_current_semester();
--update pass on enrollments
update enrollments set passed = true where mid_term >3 and end_term >3;

--refresh gpa VIEW
refresh materialized view students_gpa;

--calculate warning_level
WITH total_failed_credit AS (
    SELECT 
        e.student_id, 
        c.semester, 
        COALESCE(SUM(s.credit), 0) AS total_failed_credits
    FROM 
        enrollments e 
    LEFT JOIN 
        classes c ON e.class_id = c.class_id
    LEFT JOIN
        subjects s ON c.subject_id = s.subject_id AND e.passed = false
    where semester =current_sem
    GROUP BY 
        e.student_id, 
        c.semester
)
UPDATE students 
SET warning_level = LEAST(GREATEST(CASE
    WHEN t.total_failed_credits < 8 THEN warning_level - 1
    WHEN t.total_failed_credits < 16 THEN warning_level + 1
    ELSE warning_level + 2
END, 0), 3)
FROM total_failed_credit t
WHERE students.student_id = t.student_id;

END;
$$;


