CREATE FUNCTION public.handle_student_register() RETURNS trigger
    LANGUAGE plpgsql
    AS $$

DECLARE 
--start_time TIMESTAMP;
  --end_time TIMESTAMP;
subjectID varchar;
open_or_full integer;
cre numeric;
programID integer;
student_cre numeric;
BEGIN

select program_id,semester_credit into programID,student_cre from students where student_id=NEW.student_id LIMIT 1; 
--start_time := clock_timestamp();
  SELECT subject_id, is_open::integer * (capacity - enrolled_count) 
    INTO subjectID, open_or_full
    FROM classes 
    WHERE class_id = NEW.class_id 
    LIMIT 1;
	SELECT into cre credit FROM subjects WHERE subject_id=subjectID;
--CLASS CLOSED OR FULL
IF open_or_full <=0 THEN
RAISE EXCEPTION 'Class is not opened or is full already'; 
RETURN NULL;
END IF;
	--end_time := clock_timestamp();
	 --RAISE NOTICE 'Trigger execution time for checking Part 1: %', end_time - start_time;
--CLASS IN PROGRAM OR NOT
--start_time := clock_timestamp();
IF  (select exists(select 1 from subjects_programs where program_id = programID AND subject_id = subjectID ) ) THEN 
ELSE
RAISE EXCEPTION 'Your program doesnt contain this subject';RETURN NULL;

END IF;
	 --end_time := clock_timestamp();
	 --RAISE NOTICE 'Trigger execution time for checking Part 2: %', end_time - start_time;
--STUDENT HAS ENOUGH CREDIT OR NOT
--start_time := clock_timestamp();

IF student_cre -   cre  <0  THEN
    RAISE EXCEPTION 'You dont have enough credit to register this subject';RETURN NULL;
END IF; 
	 --end_time := clock_timestamp();
	 --RAISE NOTICE 'Trigger execution time for checking Part 3: %', end_time - start_time;
--STUDENT HAVE PASSED REQUIRED SUBJECTS OR NOT  
--start_time := clock_timestamp();
IF  exists( select
  1
from
  (
    select
      *
    from
      subjects_conditions
    where
      main_subject_id = subjectID
      LIMIT 2
  ) as t1
  left join (
    select
      subject_id
    from
      classes
    where
      class_id IN (
        select
          class_id
        from
          enrollments
        where
          student_id = NEW.student_id
          and passed = true
      )
  ) as t2
  
 on t1.main_subject_id=t2.subject_id 
where  t2.subject_id is NULL)
   THEN
RAISE EXCEPTION 'You still havent passed the required subjects for this subject: % %', NEW.student_id, subjectID;RETURN NULL;
END IF;
 --end_time := clock_timestamp();
	--RAISE NOTICE 'Trigger execution time for checking Part 4: %', end_time - start_time;
--FINISHING
--start_time := clock_timestamp();

update classes set enrolled_count=enrolled_count+1 where class_id=NEW.class_id;

update students set semester_credit = semester_credit - cre where student_id=NEW.student_id; 

--end_time := clock_timestamp();
	--RAISE NOTICE 'Trigger execution time for checking Part 5: %', end_time - start_time;


RETURN NEW;
END;
$$;


