CREATE FUNCTION public.update_student_credit() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE cre numeric;
begin 

select
  into cre credit
from
  subjects
WHERE
  subject_id = (select subject_id from classes where class_id = OLD.class_id);
update classes set enrolled_count=enrolled_count-1 where class_id=OLD.class_id;

update students set semester_credit = semester_credit+cre where student_id=OLD.student_id;
 RETURN OLD;


end;

$$;


