-- Name: students_gpa; Type: MATERIALIZED VIEW; Schema: public; Owner: postgres
--

CREATE MATERIALIZED VIEW public.students_gpa AS
 WITH weighted_scores AS (
         SELECT e.student_id,
            c.semester,
            s.credit,
            ((COALESCE(e.mid_term, (0)::numeric) * ((1)::numeric - s.weight)) + (COALESCE(e.end_term, (0)::numeric) * s.weight)) AS weighted_score
           FROM ((public.subjects s
             JOIN public.classes c ON (((c.subject_id)::text = (s.subject_id)::text)))
             JOIN public.enrollments e ON ((c.class_id = e.class_id)))
        )
 SELECT student_id,
    semester,
    (sum(((
        CASE
            WHEN (weighted_score > 8.5) THEN 4
            WHEN ((weighted_score > (7)::numeric) AND (weighted_score <= 8.5)) THEN 3
            WHEN ((weighted_score > 5.5) AND (weighted_score <= (7)::numeric)) THEN 2
            WHEN ((weighted_score > (4)::numeric) AND (weighted_score <= 5.5)) THEN 1
            ELSE 0
        END)::numeric * credit)) / sum(credit)) AS gpa
   FROM weighted_scores
  GROUP BY student_id, semester
  WITH NO DATA;


ALTER MATERIALIZED VIEW public.students_gpa OWNER TO postgres;

